import React from "react";
import Grid from "@material-ui/core/Grid";

import Product from './Product/Product';
import useStyles from './styles';

const products = [
    { id: 1, name: "T-Shirt", description: "Signature Visten T-shirt. 100% cotton.", price: "$20.99", image: "https://m.media-amazon.com/images/I/A13usaonutL._CLa%7C2140%2C2000%7C51Ra9ZOAm-L.png%7C0%2C0%2C2140%2C2000%2B0.0%2C0.0%2C2140.0%2C2000.0_AC_UX679_.png" },
    { id: 2, name: "Hoodie", description: "Signature Visten embroidered sweatshirt.", price: "$90.99", image: "https://thumbs.dreamstime.com/b/blank-hoodie-sweatshirt-color-black-back-view-spread-out-white-background-98229804.jpg" }
]



const Products = () => {
    const classes = useStyles();

    return (
        <div>
            <main>
                <Grid container justify="center" spacing={4}>
                    {products.map((product) => (
                        < Grid item key={product.id} xs={12} sm={6} md={4} lg={3} > {/* xs = {12} means for mobile devices, grid takes up whole screen. sm, md and lg mean the same thing for larger devices respectively with 6/12 representing half the screen as an example*/}
                            < Product product={product} />
                        </ Grid>
                    ))}
                </Grid>

            </main>
        </div >

    );
}

export default Products;
